import React from "react";
import './QuestionList.css';
//Import Components
import ScrollableTable from "../../components/ScrollableTable"
import QuestionListItem from "./QuestionListItem";

const mockQuestions = [
    {
        id: "5feb6904f827835ed827ddeb",
        name: "Who am I?",
        email: "who@sky.world",
        date: "2020-12-31T00:00:00.000Z",
        observations: "Who knows.",
        creationDate: "2020-12-29T17:36:04.933Z",
        __v: 0
    },
    {
        id: "5feb6904f827835ed827ddeb",
        name: "Who am I?",
        email: "who@sky.world",
        date: "2020-12-31T00:00:00.000Z",
        observations: "Who knows.",
        creationDate: "2020-12-29T17:36:04.933Z",
        __v: 0
    }
];

const columns = [ {
    Header: "Questions",
    columns: [
        {
            field: "name",
            headerName: "Name"
        },
        {
            field: "email",
            headerName: "Email"
        },
        {
            field: "date",
            headerName: "Date"
        },
        {
            field: "observations",
            headerName: "Observations"
        },
        {
            field: "creationDate",
            headerName: "Creation Date"
        }
    ]
}
]

const QuestionList = () => (
    <ScrollableTable columns = {columns} data = {mockQuestions} />
    // <ul>
    //     {questionList.map(question => (
    //         <QuestionListItem key={question.id} question={question} />
    //     ))}
    // </ul>

);

export default QuestionList;
